import React from 'react';
//import Route from 'react-router-dom/Route';
import { NavLink } from 'react-router-dom';
import clinicalSkillsImages from './clinicalSkillsImages';


const SkillsNavigation = props => (
	<header className="Skills-navigation">

	  <nav className="Skills-navigation_items">

	     <NavLink to = "/OxygenTherapy"> {clinicalSkillsImages.image}</NavLink>





	    </nav>

	    </header>

	);

export default SkillsNavigation;
